import React, {Component} from "react"

export default class Sessions extends Component {
  constructor(props) {
    super(props)

  }
  render () {
    return (
      <div>
        <col></col>
        {
          this.props.sessions.map(session => {
            return (
              <colgroup
              span={this.props.sessions.length}>
              </colgroup>
            )
          })
        }
      </div>
    )
  }
}
